import logo from './logo.svg';
import './App.css';
import React, {useEffect, useState} from 'react';

function App() {
  const [data, setData] = useState({variables: [], slides: []});

  const [lidia, setLidia] = useState(null);
  useEffect(() => {
    fetch("http://localhost:7777/api/124124331124")
      .then((res) => res.json())
      .then((data) => {
        setLidia(data.variables[0].idVariable);
        console.log(data.variables[0].idVariable);
        setData(data)}) 
      .catch((error) => console.log(error.message));  
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <p>Value A: {lidia}</p>
        <p>Value B: {data.slides.idSlide}</p>
      </header>
    </div>
  );
}

export default App;
